import React, { Component } from 'react';

class ImageList extends Component {
    constructor(){
        super();
        this.state = {

        }
    }
    render(){
        console.log(this.props, 'this.props IMAGELIST')
        console.log(this.props.images, 'this.props.images IMAGELIST')

        const imageList1 = this.props.map((image, i) => {
            return(
                <img alt="" key={ image } src={ image } />
            )
        })
        return(
            <div>
                { imageList1 }
            </div>
        )
    }
}

export default ImageList;
